  false,\n\t\"url\": null,\n\t\"notes\": \"This report first presents a description
  of the local community and economy near the Don Edwards San Francisco Bay NWR. Next,
  the report describes methods used to conduct a regional economic impact analysis.
  An analysis of the final Comprehensive Conservation Plan (CCP) management strategies
  that could affect stakeholders, residents, and the local economy is then presented.
  The management activities of economic concern in this analysis are: spending in
  the local community by Refuge visitors; Refuge personnel salary spending; and Refuge
  purchases of goods and services within the local community.\",\n\t\"license_title\":
